export async function GET(request, { params }) {
  const { searchParams } = new URL(request.url);
  const dateFrom = searchParams.get("dateFrom") ?? dayjs().format("YYYY-MM-DD");
  const dateTo =
    searchParams.get("dateTo") ??
    dayjs().add(1, "day").format("YYYY-MM-DD 00:00:00");

  const requestParams = {
    start_datetime: dateFrom,
    end_datetime: dateTo,
  };

  switch (parseInt(params.modelId)) {
    case 5:
      var response = await getModel5Data();
      return NextResponse.json(response);
      break;
    case 6:
      var response = await getModel6Data(requestParams);
      return NextResponse.json(response);
    default:
      return NextResponse.json(params);
  }
}

