async function getModel6Data(req) {
  var start_datetime =
    req?.start_datetime ?? dayjs().format("YYYY-MM-DD 00:00:00");
  var end_datetime =
    req?.end_datetime ?? dayjs().add(1, "day").format("YYYY-MM-DD 00:00:00");

  var sql = `
    SELECT CONVERT(varchar(10), Timestamp,120) AS 'Date',
	CAST ( DATEPART( HOUR, Timestamp ) AS VARCHAR ) AS 'Hour',
	SUM ( num_in ) AS TotalIn,
	SUM ( num_out ) AS TotalOut 
FROM
	EMS_Model6_Result 
WHERE
	Timestamp >= CONVERT ( datetime, '${start_datetime}' )
	AND Timestamp < CONVERT ( datetime, '${end_datetime}' ) 
GROUP BY
CONVERT(varchar(10), Timestamp,120),
	DATEPART( HOUR, Timestamp )`;

  // console.log("sql", sql);
  const res = await ExecuteQuery(sql);

  var responseArray = [];
  res.forEach((item) => {
    var responseObject = {
      datetime: dayjs(item.Date)
        .add(item.Hour, "hour")
        .format("YYYY-MM-DD HH:mm:ss"),
      total_in: item.TotalIn,
      total_out: item.TotalOut,
    };
    responseArray.push(responseObject);
  });
  return responseArray;
}

